      "cell_type": "code",
      "source": [
        "# Basic R operations\n",
        "data <- mtcars\n",
        "head(data)\n",
        "\n",
        "# Plotting\n",
        "plot(data$mpg, data$hp, main=\"MPG vs Horsepower\")\n",
        "\n",
        "# Statistical analysis\n",
        "summary(lm(mpg ~ hp + wt, data=data))\n",
        "\n",
        "# Install packages\n",
        "install.packages(\"ggplot2\")\n",
        "library(ggplot2)\n",
        "ggplot(data, aes(x=hp, y=mpg)) + geom_point()"
      ],
